import React from "react";
import { motion } from "framer-motion";

class Android extends React.Component {
    render() {
        return (
            <>
                <h1 className="middle">Android</h1>
                <main style={{paddingLeft: "2%", paddingRight: "2%"}}>
                    <div className="grid">
                    <div className="clickable" onClick={() => window.location += "/nimmgameapp"}>
                            <span className="middle">NimmGameApp</span>
                            <img style={{paddingLeft:"36%", paddingRight:"35%"}} alt="" src="https://raw.githubusercontent.com/SillyGoose123/NimmGameApp/main/app/src/main/res/mipmap-xhdpi/ic_launcher.png"/>
                        </div>    
                    </div>                   
                </main>      
            </>
        )
    }
}

function createComponent(params) {
    
}

export default Android;
